import React from 'react';
import logo from './logo.svg';
import './App.css';
import navbar from './components/navigation';
//<Route path='/' exact component={Home} />
function App() {
  return (
    <>
    <Router>
      <navbar/>
      <Switch>
        <Route path = '/Users/timkim/Desktop/CMPE133/Recipe-Radar/frontend/src/components/navigation.js' exact component = {navbar}></Route>
      </Switch>
    </Router>
    </>
  );
}

export default App;
